import React from 'react';


function FormField(value, onChange) {

    return (
        <div>
            <label>
                Nome da Categoria:
                <input>
                    type="text"
                    value={value.nome}
                    name="nome"
                    onChange={handleChange}
                </input>
            </label>
        </div>
    )
}




export default FormField;
